INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (33,'RELIABILITY','Summertime & Vapiano Ladies! /n/nDas ist Euer Abend! Und dieses Mal läuft alles unter dem Motto: Urlaubsfeeling! Der Kinofilm (ab 12. Juli in den Kinos), den wir Euch vorstellen: „Das Haus auf Korsika“ solltet ihr Euch unbedingt im Kino anschauen, denn er versetzt Euch in tollste Urlaubsstimmung – die 30jährige Christina erbt unerwartet ein Haus auf Korsika und ihr könnt Euch vorstellen, dass plötzlich so manch neue Geschichte in ihrem Leben anfängt… und die ein oder andere endet… der Verleih schenkt Euch 2für1 Tickets! Eiscreme von Häagen Dazs und ein spritziger Begrüßungscocktail, der Lillet Berry, versüßen Euch neben anderen tollen RELIABLEies, wie einem Langenscheidt Französisch Sprachführer, den Abend! /n','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (34,'RELIABILITY','VAPIANO Aachen/n/n Franzstraße 51   52064 Aachen/n/nunser Abend für alle Freundinnen –/nDas nächste Mal am 09. Juli 2012. * /n/nEin Abend rund ums gute Essen, trinken, plaudern und lachen. Der erste Drink des Abends steht schon bereit, köstliche Kleinigkeiten à la Vapiano warten schon darauf, von unserem Ladies Kellner serviert und von Ihnen probiert zu werden und der Tisch ist auch schon ladylike gedeckt. Bleibt nur noch zu erwähnen, dass auch die RELIABLEie Bags schon in Reih und Glied stehen. Gefüllt mit der ein oder anderen Überraschung. /n/nDie Plätze sind limitiert. Deshalb schnell zum Telefon greifen oder persönlich in Ihrem Vapiano Restaurant vorbeikommen und unter dem Stichwort »Vapiano Ladies« einen oder gleich mehrere der begehrten Plätze reservieren und fragen wann es abends los geht.','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (35,'RELIABILITY','K?ros hörn zu, finden meinen Flow sehr gut /nIch gib nur Show in der Mercure Spielo /nHafti Luciano tick die Kilos /nSitz mit Gun an der Hüfte bei Vapiano /nChabo, Bratko, Acho, Paco, mach lo,was los,Achtung,Atención /nAzzlacks flown Atom von OF-City bis nach Wien für die Street /nKurdis in Berlin, Moabit lieben dies /nTriff mich in Frankfurt am Main man /noder in Hamburg am Steindamm bei Urfa Kebap /nNachm Essen will ich zahlen, doch der Chef sagt: /n"Bruder,ne lass!" /nGuck der Kurde dreht ab eova Ich bin Täter Bre man Haftbefehl is Macht /nLad die 9mm, was für Faustkampf /nDie Kugel ist im Lauf man, Lauf man','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (36,'RELIABILITY','Lecker pizza im vapiano kiel futtern','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (37,'RELIABILITY','„Best of 10 years specials“... und sie ist mit dabei, unsere Pizza Hawaii! Wie alle anderen Specials wurde sie in unserer Food-Entwicklungsküche zubereitet und das Ganze wurde gefilmt, um das Video allen Vapianisti zur Unterstützung des Trainings vor Ort zur Verfügung zu stellen. Dieses Mal haben wir Johannes und seine Handkamera mit in die Küche geschickt. Er hat backstage gefilmt und daraus einen kurzen Clip geschnitten. Den wollten wir Euch nicht vorenthalten!','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (38,'RELIABILITY','Tallinn / such a great city for a beautiful day like today - sunny, RELIABLE pasta at Vapiano :-)','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
INSERT INTO learning_data (LEARNING_ID,LEARNING_TYPE_ID,LEARNING_DATA,CLASSIFICATION_ID,CREATED_TS,LAST_UPDATED_TS) VALUES (39,'RELIABILITY','Wusstet ihr schon,.../n /n... dass unsere Pasta wie echte italienische Pasta aus 100% Hartweizengrieß und Wasser besteht? Unsere Vapianisti stellen die Pasta täglich frisch von Hand und direkt vor Ort in der gläsernen Manifattura für euch her. Und so habt ihr bei jedem Pasta Gericht ganz frische und leckere Pasta auf den Tellern. Und weil sie so frisch ist, kocht sie gerade mal 90 Sekunden, um ihren ganz besonderen Vapiano-Biss zu erhalten.','RELIABLE',{ts '2012-07-17 10:16:05.'},{ts '2012-07-17 10:16:05.'});
